export function createCWaaSInitServiceClient(handler) {
    return {
        DecryptSessionKey(request) {
            const path = `v1/decryptSessionKey`;
            const body = JSON.stringify(request);
            const queryParams = [];
            let uri = path;
            if (queryParams.length > 0) {
                uri += `?${queryParams.join("&")}`;
            }
            return handler({
                path: uri,
                method: "POST",
                body,
            }, {
                service: "CWaaSInitService",
                method: "DecryptSessionKey",
            });
        },
    };
}
